const total = $input.first().json.count;
const chunkSize = 5000;

const numItems = Math.ceil(total / chunkSize);

const items = [];
for (let i = 0; i < numItems; i++) {
  const offset = i * chunkSize;
  const remaining = total - offset;
  const limit = remaining >= chunkSize ? chunkSize : remaining;

  items.push({
    json: {
      index: i + 1,      // 1-based chunk number
      offset,            // start row
      limit,             // how many rows in this chunk
      originalCount: total,
    },
  });
}

return items;

// Number of groups/workers
const numWorkers = 6;

// Calculate how many items per group
const totalItems = items.length;
const itemsPerGroup = Math.ceil(totalItems / numWorkers);

// Create groups
const output = [];

for (let i = 0; i < numWorkers; i++) {
  const start = i * itemsPerGroup;
  const end = start + itemsPerGroup;
  const groupItems = items.slice(start, end).map(i => i.json);

  if (groupItems.length > 0) {
    output.push({
      json: {
        worker: `worker ${i + 1}`,
        items: groupItems
      }
    });
  }
}

return output;

