const uuidArray = $('Webhook').first().json.uuid;

// Number of groups/workers
const numWorkers = 4;

// Safety check
if (!Array.isArray(uuidArray)) {
  throw new Error("uuid is not an array");
}

// Calculate how many items per group
const totalItems = uuidArray.length;
const itemsPerGroup = Math.ceil(totalItems / numWorkers);

// Create groups
const output = [];

for (let i = 0; i < numWorkers; i++) {
  const start = i * itemsPerGroup;
  const end = start + itemsPerGroup;
  const groupItems = uuidArray.slice(start, end);

  if (groupItems.length > 0) {
    output.push({
      json: {
        worker: `worker ${i + 1}`,
        uuids: groupItems
      }
    });
  }
}

return output;

